import React from 'react';

const Cards = {
    borderRadius: "12px",
    padding: "12px",
}

const CardStyle = {
    textAlign: "center",
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
}

const imageStyle = {
    height: "50vh",
    borderRadius: "12px"
}

export default function ProjectCard({ images, title })  {
    return(
        <div className={Cards}>
            <h3>{title}</h3>
            <div className={CardStyle}>
                {images.map((value) => {
                    return <img style={imageStyle} src={value} alt="Photos of projects" />
                })}
            </div>
        </div>
    )
}
